import { InternationalizationComponent } from './internationalization.component';


import { HttpModule, JsonpModule } from '@angular/http';
import { BrowserModule } from '@angular/platform-browser';
import 'rxjs/add/operator/map';
import { NgModule, ModuleWithProviders, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';


import { CalendarModule } from '@syncfusion/ej2-ng-calendars';






import { SharedModule } from './common/shared.module';




@NgModule({
    imports: [CalendarModule, SharedModule, HttpModule, JsonpModule, BrowserModule],
declarations: [InternationalizationComponent],
bootstrap: [InternationalizationComponent]
})
export class AppModule { }

internationalization.component:
import * as n8 from './common/cldr-data/main/de/currencies.json';
import * as n7 from './common/cldr-data/main/de/numbers.json';
import * as n6 from './common/cldr-data/main/de/timeZoneNames.json';
import * as n5 from './common/cldr-data/main/de/ca-gregorian.json';
import * as n4 from './common/cldr-data/main/zh/currencies.json';
import * as n3 from './common/cldr-data/main/zh/numbers.json';
import * as n2 from './common/cldr-data/main/zh/timeZoneNames.json';
import * as n1 from './common/cldr-data/main/zh/ca-gregorian.json';
import * as n0 from './common/cldr-data/supplemental/numberingSystems.json';
import { Component, ViewEncapsulation, Inject } from '@angular/core';
import { loadCldr, L10n } from '@syncfusion/ej2-base';

@Component({
    selector: 'control-content',
    templateUrl: 'internationalization.html',
    styleUrls: ['calendar-style.css'],
    encapsulation: ViewEncapsulation.None
})
export class InternationalizationComponent {
    public date: Object = new Date();
    locale: string = 'de';
    ngOnInit(): void {   
        loadCldr(
            n0,
            n1,
            n2,
            n3,
            n4,
            n5,
            n6,
            n7,
            n8
        );
    }
    changeLocale() {
        let culture: string = (document.getElementById('cultures') as HTMLSelectElement).value;
        this.locale = culture;
    }

     onValueChange(args: any):void {
        (<HTMLInputElement>document.getElementById('selected')).textContent = 'Selected Value: ' + args.value.toLocaleDateString();    
    }
}

calendar-style.css:
#control_wrapper {
    margin: 0 auto;
    max-width: 300px;
}

.control-section {
    margin: 25px auto;
}

#control_wrapper #container {
    min-height: 300px;
}

.e-bigger #control_wrapper #container {
    min-height: 380px;
}

#selected {
    height: 50px;
    width: 248px;
    display: block;
    font-weight: inherit;
    line-height: 50px;
    color: rgba(0, 0, 0, 0.58);
}

span.e-icons.highlight {
    margin-top: -13px;
    display: block;
    margin-left: 4px;
}

span.e-icons.highlight,
span.e-icons.highlight:before {
    color: rgb(0, 0, 255);
}

span.e-icons.highlight:before {
    content: "\e865";
    vertical-align: middle;
    margin-right: 3px;
    font-size: 4px;
    position: relative;
    top: -1px;
    font-weight: normal;
}

.e-selected span.e-icons.highlight:before {
    color: #fff;
}

span.e-icons.highlight {
    margin-top: -11px;
    display: block;
    margin-left: 4px;
}

.e-calendar .e-content span.special,
.e-calendar .e-content span.daycell {
    font-weight: bold;
}

.e-calendar .e-content span.special {
    color: red;
}

.e-calendar .e-content span.daycell {
    color: #ff9e00;
}

#start,
#end {
    line-height: normal;
    height: 36px;
    width: 100%;
    border: 1px solid rgba(158, 158, 158, 0.45);
    text-indent: .857em;
    font-size: 13px;
    font-family: Segoe UI;
    margin-bottom: 10px;
}

.form-group .content-wrapper {
    float: left;
    padding: 0 10px;
}

::-webkit-input-placeholder {
    /* Chrome/Opera/Safari */
    color: black;
    font-size: 14px;
    opacity: 0.5;
    font-style: oblique;
}

:-moz-placeholder {
    /* Firefox 18- */
    color: black;
    font-size: 14px;
    opacity: 0.5;
    font-style: oblique;
}

::-moz-placeholder {
    /* Firefox 19+ */
    color: black;
    font-size: 14px;
    opacity: 0.5;
    font-style: oblique;
}

:-ms-input-placeholder {
    color: black;
    font-size: 14px;
    opacity: 0.5;
    filter: alpha(opacity=50);
    font-style: oblique;
}

